//. Crie um componente chamado Carros.js e insira uma imagem de carro e uma lista com 5 modelos de carro.
import React from "react"

//Importando imagens em um componente
import carro1 from '../../img/bronco.jpg'

export default function Carro() {

    return (

        <div>
            <img src={carro1} alt="Carro Bruto!" width="300px" />

            <ul>
                <li>Renegade</li>
                <li>NSX-Acura</li>
                <li>Fusca</li>
                <li>Opala</li>
                <li>IX-35</li>
            </ul>

        </div>

    )
}
